		public  function makeWord($word,$id,$viewbox ,$height=null,$width=null){
				$letters = array();
				$duplicate = -1;
			
			$svg = "<svg xmlns:dc='http://purl.org/dc/elements/1.1/'
   xmlns:cc='http://creativecommons.org/ns#'
   xmlns:rdf='http://www.w3.org/1999/02/22-rdf-syntax-ns#'
   xmlns:svg='http://www.w3.org/2000/svg'
   xmlns='http://www.w3.org/2000/svg'
   version='1.1'
   viewBox='{$viewbox}'
   id='{$id}'
   class='bubbleletter_word'
  ";
   if($height != null && $width != null){
   	$svg .= "height='{$height}' 
   width='{$width}'>";
   }else if ($height != null){
   	$svg .= "height='{$height}'>";
   }else if($width != null){
   	$svg .= "width='{$width}'>";
   }else{
   	$svg .= ">";
   }
			for($i=0;$i<strlen($word);$i++){
				
					
				
				switch(strtolower($word{$i})){
					
					case "a" : array_push($letters,array($this->a,'A')); 
					break;	
					case "b" : array_push($letters,array($this->b,'B'));
					break;
					case "c" : array_push($letters,array($this->c,'C'));
					break;								
					case "d" : array_push($letters,array($this->d,'D'));
					break;					
					case "e" : array_push($letters,array($this->e,'E'));
					break;
					case "f" : array_push($letters,array($this->f,'F'));
					break;
					case "g" : array_push($letters,array($this->g,'G'));
					break;
					case "h" : array_push($letters,array($this->h,'H'));
					break;
					case "i" : array_push($letters,array($this->i,'I'));
					break;
					case "j" : array_push($letters,array($this->j,'J'));
					break;
					case "k" : array_push($letters,array($this->k,'K'));
					break;
					case "l" : array_push($letters,array($this->l,'L'));
					break;
					case "m" : array_push($letters,array($this->m,'M'));
					break;
					case "n" : array_push($letters,array($this->n,'N'));
					break;
					case "o" : array_push($letters,array($this->o,'O'));
					break;
					case "p" : array_push($letters,array($this->p,'P'));
					break;
					case "q" : array_push($letters,array($this->q,'Q'));
					break;
					case "r" : array_push($letters,array($this->r,'R'));
					break;
					case "s" : array_push($letters,array($this->s,'S'));
					break;
					case "t" : array_push($letters,array($this->t,'T'));
					break;
					case "u" : array_push($letters,array($this->u,'U'));
					break;
					case "v" : array_push($letters,array($this->v,'V'));
					break;
					case "w" : array_push($letters,array($this->w,'W'));
					break;
					case "x" : array_push($letters,array($this->x,'X'));
					break;
					case "y" : array_push($letters,array($this->y,'Y'));
					break;
					default : array_push($letters,array(" ", " "));
					break;
				}
			}
for($i=0;$i<count($letters);$i++){
array_push($letters[$i], 0);
	}
			for($i=0;$i<count($letters);$i++){
	
					
				for($x=($i+1); $x < count($letters) ;$x++ ){
					
					if(($letters[$i][1] == $letters[$x][1]) ){
						
						$letters[$x][0] = preg_replace("/id='[A-Z]'/", "id='{$letters[$x][1]}_duplicate_letter{$letters[$i][2]}'", $letters[$x][0]);
						$letters[$x][0] = preg_replace("/id='[A-Z]_outline'/", "id='{$letters[$x][1]}_duplicate_outline{$letters[$i][2]}'", $letters[$x][0]);
						$letters[$x][0] = preg_replace("/id='[A-Z]_fill'/", "id='{$letters[$x][1]}_duplicate_fill{$letters[$i][2]}'", $letters[$x][0]);
						$letters[$i][2]++;
					}
					
					
			}
			
			
				
			$svg .= $letters[$i][0];
			
		}
			$svg .= "</svg>";
		
			return $svg;
		}
